function M.setup_highlights(ns)
  ns = ns or 0
  for group, hex in pairs(M.groups) do
    vim.api.nvim_set_hl(ns, group, { bg = hex })
  end
end

function M.components()
  local comps = {}
  for i, line in ipairs(M.lines) do
    table.insert(comps, {
      type = "text",
      val = line,
      opts = { hl = M.line_hls[i] },
    })
  end
  return comps
end

return M